import React from 'react'
import Modal from '@material-ui/core/Modal';

const ModalPopOver = () => {
    return (
        <Modal
            open={open}
            onClose={handleClose}
            aria-labelledby="simple-modal-title"
            aria-describedby="simple-modal-description"
            >
            Hola mundo!
        </Modal>
    )
}

export default ModalPopOver
